import React from "react";

const e = React.createElement;
const consoleStyle = {
  width: "100%",
  height: 510,
  resize: "none",
  outline: "none"
};

class Console extends React.Component {
  constructor(props) {
    super(props);
  }

  renderLines() {
    return this.props.console.join("\n");
  }

  render() {
    return e(
      "textarea",
      {
        onChange: this.props.consoleValueChanged,
        style: consoleStyle
      },
      this.renderLines()
    );
  }
}

export default Console;
